import { Product } from "../../App";
import "./card.scss";

export const Card = (product: any) => {
    const { id, name, color, year, pantone_value } = product.product as Product;
    return (
        <>
            <tr>
                <p>Id: {id}</p>
                <p>Name: {name}</p>
                <p>Color: {color}</p>
                <p>Year: {year}</p>
                <p>Pantone value: {pantone_value}</p>
            </tr>
        </>
    );
};

